/**
 * @return a List for QueryNode object. Returns null, for nodes that do not
 *         contain children. All leaf Nodes return null.
 */
public final List<QueryNode> getChildren() {
  if (isLeaf() || this.clauses == null) {
    return null;
  }
  return this.clauses;
}

